    robots: robots,
    searchfield: ''
}

class App extends Component {
    render() {
        return (
            <div className='tc'>
                <h1 className='tc'>Robot Friends </h1>
                <SearchBox className='tc' />
                <CardList robots={robots} />
            </div>
        );
    }
}

export default App;
